import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatDividerModule } from '@angular/material/divider';
import { MatCardModule } from '@angular/material/card';
import { IContract } from 'src/app/core/models/contract';

@Component({
  selector: 'app-subscriptions',
  standalone: true,
  imports: [CommonModule, MatDividerModule, MatCardModule],
  templateUrl: './subscriptions.component.html',
  styleUrls: ['./subscriptions.component.css'],
})
export class SubscriptionsComponent {
  subscriptions: IContract[] = [];

  trackBySubscriptionId(index: number, subscription: IContract): number {
    return subscription.subscriptionId;
  }
}
<mat-card class="subscriptions">
  <mat-card-header>
    <mat-card-title>Subscriptions</mat-card-title>
  </mat-card-header>

  <mat-card-content *ngFor="let subscription of subscriptions">
    <p class="subscription">{{ subscription }}</p>
    <mat-divider></mat-divider>
  </mat-card-content>
</mat-card>
